import React, { useState } from 'react';
import './navbar.css';
import { Link } from 'react-router-dom';
import Hamburger from 'hamburger-react';

function Navbar() {
    const [isOpen, setOpen] = useState(false);

    const menuStyles = {
        maxHeight: isOpen ? '200px' : '40px',
        overflow: 'hidden',
        transition: 'max-height 0.3s ease-in-out',
    };

    const burgerStyles = {
        position: 'absolute',
        top: '10px',
        left: '20px',
    };

    return (
        <nav className='bg-gray-900 p-4 w-100'> 
            <div className=' container w-full flex justify-center  '>
                <div className='md:hidden lg:hidden xl:hidden' style={burgerStyles}>
                    <Hamburger toggled={isOpen} toggle={setOpen} />
                </div>
                <div className='hidden sm:flex flex space-x-4  '>
                    <div className='flex-auto'><Link to="/" className='text-white text-center'>Home</Link></div>
                    <div className='flex-auto'><Link to="/tools" className='text-white text-center'>Mon matériel</Link></div>
                    <div className='flex-auto'><Link to="/services" className='text-white text-center'>Services</Link></div>
                    <div className='flex-auto'><Link to="/about" className='text-white text-center'>A propos</Link></div>
                    <div className='flex-auto'><Link to="/contact" className='text-white text-center'>Contact</Link></div>
                </div>
                <div className=''>
                    <div className='md:hidden lg:hidden xl:hidden' style={menuStyles}>
                        <div className='text-3xl font-skyvision text-white block py-2 text-center'><h1>SkyVision</h1></div>
                        <Link to="/" className='text-white block py-2 text-center'>Home</Link>
                        <Link to="/tools" className='block py-2 text-white text-center'>Mon matériel</Link>
                        <Link to="/services" className='text-white block py-2 text-center'>Services</Link>
                        <Link to="/about" className='text-white block py-2 text-center'>A propos</Link>
                        <Link to="/contact" className='text-white block py-2 text-center'>Contact</Link>
                    </div>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
